import React from 'react'
import { Card, Icon, Image, Button } from 'semantic-ui-react'

handleDeleteButton = () => {
  props.deletePet(props.pet)
  console.log("DELETE BUTTON CLICKED!!!")
}

const PetCard = (props) => (
// handleDeleteButton = () => {
  //   props.deletePet(props.pet)
  // }



      <Card>
        {console.log(props.pet.name)}
        <Image src={props.pet.image} wrapped ui={false} />
        <Card.Content>
<Card.Header>{props.pet.name}</Card.Header>
          <Card.Meta>
            <span className='date'>{props.pet.animal_type}</span>
          </Card.Meta>
          <Card.Description>
            {props.pet.age}
          </Card.Description>
        </Card.Content>
        <button className="ui button">Edit Pet</button>
        <button className="ui button" onClick={handleDeleteButton()}>Delete Pet</button>

      </Card>
)

export default PetCard
